import React, { Component } from "react";
import "./my_css.css";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import m1 from  "./images/Bhutan.webp";
import b from "./images/b.jpg";
import k from "./images/k.jpg";
import s from "./images/puri.jpg";
export class Home extends Component {
  render() {
    return (
      <div><h1>INDIAN RAILWAYS</h1>
        <div
          class="row"
          style={{
            marginTop: "20rem",
            marginLeft: "0px",
            marginRight: "1rem",
            padding: "10px 1px 1px 0px",
          }}
        >
          {" "}
          <h3 style={{ textAlign: "center" }}>Available Packages</h3>
          <div class="col-sm-4">
            <img
              class="card-img-top"
              src={m1}
              alt="Card image cap"
              style={{ height: "15rem", width: "20rem" }}
            />
            <div class="card-body">
              <h5
                class="card-title"
                style={{ backgroundColor: "white", width: "20rem" }}
              >
                Rail Tour Package
              </h5>
              <p class="card-text" style={{ width: "15rem" }}>
                hello
              </p>
            </div>
          </div>
          <div class="col-sm-4">
            <img
              class="card-img-top"
              src={s}
              alt="Card image cap"
              style={{ height: "15rem", width: "20rem" }}
            />
            <div class="card-body">
              <h5
                class="card-title"
                style={{ backgroundColor: "white", width: "20rem" }}
              >
                Rail Tour Package
              </h5>
              <p class="card-text" style={{ width: "20rem" }}>
                hello
              </p>
            </div>
          </div>
          <div class="col-sm-4">
            <img
              class="card-img-top"
              src={b}
              alt="Card image cap"
              style={{ height: "15rem", width: "20rem" }}
            />
            <div class="card-body">
              <h5
                class="card-title"
                style={{ backgroundColor: "white", width: "20rem" }}
              >
                Rail Tour Package
              </h5>
              <p class="card-text" style={{ width: "20rem" }}>
                hello
              </p>
            </div>
          </div>
        </div>

        <footer id="footer">Get connected on Social media</footer>
      </div>
    );
  }
}

export default Home;
